// Logout.js
import { toast , ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
export const handleLogout = (onLogout, navigate) => {
  localStorage.removeItem("users");
  if (onLogout) onLogout();
  navigate("/Signup");
};
